import React from 'react'
import "./MainSection.css"
import IpsumLogo from '../Images/IpsumLogo.svg'
export default function Footer() {
  return (
    <div  className='footer'>
        <img src={IpsumLogo} alt='img.png'></img>
        
    </div>
  )
}
